import {} from '../actions';
import produce from 'immer';
const initialState = {
	descriptionTitle: 'Built for <br /> 헬린이',
	descriptionContent: `GitHub is a development platform inspired by the way you work. 
	From open source to business, you can host and review code, manage projects, 
	and build software alongside 50 million developers.`,
};
const reducer = (state = initialState, action) => {
	return produce(state, draftState => {
		switch (action.type) {
			default:
				return state;
		}
	});
};

export default reducer;
